import React, { Component } from "react";
import MuiTreeView from 'material-ui-treeview';

export class Temp extends Component {

  constructor() {
    super();
    this.state = {
      tree: [
        {
          value: 'Parent A',
          nodes: [{ value: 'Child A' }, { value: 'Child B' }],
        },
        {
          value: 'Parent B',
          nodes: [
            {
              value: 'Child C',
            },
            {
              value: 'Parent C',
              nodes: [
                { value: 'Child D' },
                { value: 'Child E' },
                { value: 'Child F' },
              ],
            },
          ],
        },
      ]
    };
  };

  render() {
    return (
      <>
        <div className="container">
        <MuiTreeView tree={this.state.tree} />
        </div>
      </>
    );
  }
}

export default Temp;
